import { useDispatch } from "react-redux";
import { closePopup } from "../../store/popup";
import { GrayButtonPopup } from "../../styles/Buttons";
import { inputPayment } from "../../styles/Constants";
import { PopupWindowBox } from "../../styles/Input";
import { setSingleInput } from "../functions/setInputsToForm";

export const PopupChoose = (props: any) => {
  const dispatch = useDispatch();
  function close() {
    dispatch(closePopup());
    props?.popup.other(props.popup.type, "xD15:00");
  }
  return (
    <PopupWindowBox>
      <form onSubmit={props?.handle}>
        {setSingleInput(
          inputPayment,
          props?.popup.register,
          props?.popup.other
        )}
      </form>
      <GrayButtonPopup onClick={() => close()}>Choose</GrayButtonPopup>
    </PopupWindowBox>
  );
};
